script: |
  super -f text -I q1535.spq | sort > q1535.out

inputs:
  - name: q1535.spq
    data: |
      SELECT ALL + col1 FROM tab2 (FORMAT parquet) cor0 WHERE NOT - col1 * - 49 BETWEEN - CAST ( NULL AS INTEGER ) * + - col0 / + col0 AND - + col0 * + col1 + + - 62 * + col2 * + col2;
  - name: tab2

outputs:
  - name: q1535.out
    data: |
      51
      67
      77
